import React from 'react';
import './sidebar.css';

const Sidebar = ({ setActive }) => {
  const handleSidebarClick = (section) => {
    setActive(section);
  };

  return (
    <div className="flex flex-col bg-[#222] text-[white] w-1/5 min-w-[200px] h-screen sticky top-0">
      <p className="sidebar-item" onClick={() => handleSidebarClick('dashboard')}>
        Dashboard
      </p>
      <p className="cursor-pointer text-base text-left p-[15px] border-b-[#444] border-b border-solid" onClick={() => handleSidebarClick('apiKeys')}>
        API Keys
      </p>
      <p className="cursor-pointer text-base text-left p-[15px] border-b-[#444] border-b border-solid" onClick={() => handleSidebarClick('sdk')}>
        SDKs
      </p>
      <p className="cursor-pointer text-base text-left p-[15px] border-b-[#444] border-b border-solid" onClick={() => handleSidebarClick('deployments')}>
        Deployments
      </p>
      <p className="cursor-pointer text-base text-left p-[15px] border-b-[#444] border-b border-solid" onClick={() => handleSidebarClick('wizard')}>
        Wizard
      </p>
    </div>
  );
};

export default Sidebar;
